	INSERT INTO livros(created_by, last_modified_by, codBarras, imagenUrl, nome, edicao,  idioma,  descricao, isbn13, numeroPaginas, dataPublicacao, valorUnitario, idEditora, quantidade) VALUES ('system', 'system', '5417740815', 'https://picsum.photos/id/1/200/300','Ansiedade 2 - Autocontrole - Como Controlar o Estresse e Manter o Equilíbrio','Ed. 1ª','PORTUGUES','Em Ansiedade 2 - Autocontrole, o psiquiatra e psicoterapeuta Augusto Cury revela os segredos para gerenciar o estresse e desenvolver o autocontrole, essencial para uma vida emocional saudável e plena. Além disso, apresenta a diferença entre ansiedade e estresse e ressalta que os dois são essenciais para a sobrevivência humana, mas que, como tudo na vida, precisam ser dosados. Alguns dos conceitos utilizados pelo autor foram apresentados no mega best-seller Ansiedade – Como enfrentar o mal do século, como, por exemplo, a Síndrome do Pensamento Acelerado (created_by, last_modified_by, SPA), que vem pouco a pouco nos transformando em prisioneiros em nossa própria mente, suas consequências alarmantes e técnicas para enfrentá-la. Neste novo livro, Cury usa partes de sua própria história – de adolescente desinteressado a pesquisador com livros publicados em muitos países – para mostrar como a ansiedade e a SPA podem sabotar a maturidade e impedir o ser humano de ser líder de si mesmo. Cury conta como ele mesmo utilizou essas técnicas para vencer o medo de fracassar e alcançar o êxito profissional e Clientel.', '9788557170438',192,'2016-03-10', 10, 1000, 30);
	INSERT INTO livros(created_by, last_modified_by, codBarras, imagenUrl, nome, edicao,  idioma,  descricao, isbn13, numeroPaginas, dataPublicacao, valorUnitario, idEditora, quantidade) VALUES ('system', 'system', '9085468531', 'https://picsum.photos/id/2/200/300','Java - Como Programar', 'Ed. 10ª',      'PORTUGUES',   'Milhões de alunos e profissionais aprenderam programação e desenvolvimento de software com os livros Deitel®. Java: como programar, 10ª edição, fornece uma introdução clara, simples, envolvente e divertida à programação Java com ênfase inicial em objetos. Destaques incluem: rica cobertura dos fundamentos com exemplos reais; apresentação com ênfase inicial em classes e objetos; uso com Java™ SE 7, Java™ SE 8 ou ambos; Java™ SE 8 abordado em seções modulares opcionais; lambdas, fluxos e interfaces funcionais usando métodos padrão e estáticos do Java SE 8; Swing e GUI do JavaFX: elementos gráficos e multimídia; conjunto de exercícios "Fazendo a diferença"; tratamento de exceções integrado; arquivos, fluxos e serialização de objetos; concorrência para melhor desempenho com multiprocessamento; o livro contém o conteúdo principal para cursos introdutórios; outros tópicos: recursão, pesquisa, classificação, coleções genéricas, estruturas de dados, multithreading, banco de dados (created_by, last_modified_by, JDBC e JPA).', '9788543004792', 968, '2016-06-10',15.00, 1001, 60);
	INSERT INTO livros(created_by, last_modified_by, codBarras, imagenUrl, nome, edicao,  idioma,  descricao, isbn13, numeroPaginas, dataPublicacao, valorUnitario, idEditora, quantidade) VALUES ('system', 'system', '9085345531', 'https://picsum.photos/id/3/200/300','Vade Mecum Saraiva','Ed. 27ª',          'PORTUGUES', 'Pioneira na exemplar técnica desenvolvida de atualização de Códigos e Legislação, como comprova o avançado número de suas edições e versões, a Editora Saraiva apresenta a edição aumentada e atualizada de sua principal obra: o Vade Mecum Saraiva. Com novo projeto gráfico, conta com o acréscimo de mais de 140 diplomas (created_by, last_modified_by, entre leis, decretos, regimentos internos etc.) em relação à edição anterior. Assim, passa a reunir as normas mais importantes do ordenamento jurídico brasileiro, com destaque para: - Código Penal Militar, Código de Processo Penal Militar e Estatuto dos Militares - Legislação Previdenciária - Principais Convenções Internacionais - Regimentos Internos do STF e do STJ (created_by, last_modified_by, divisão exclusiva = agilidade na pesquisa) O conteúdo foi criteriosamente selecionado com base na grade curricular das principais faculdades de direito e em editais de concursos para carreiras jurídicas. Sua estrutura foi pensada de forma a proporcionar o maior número de diplomas legislativos sem comprometer a legibilidade e o trabalho editorial. As notas de correlação entre as matérias, já tão tradicionais nas obras de legislação Saraiva, foram mantidas, assim como os índices multifuncionais, que permitem rápida localização de qualquer assunto por ordem alfabética, cronológica, pelo número do diploma ou por seu tema. Tradição, organização e estrutura, aliadas à confiabilidade do nome Saraiva, explicam que seja há mais de 10 anos o produto de legislação mais vendido no mercado. Últimas Atualizações da 27ª edição (created_by, last_modified_by, fechamento em 4-1-2019): - Código Civil Condomínio em multipropriedade - Lei n. 13.777, de 20-12-2018 Quórum de deliberação nas sociedades limitadas - Lei n. 13.792, de 3-1-2019 - Código de Processo Civil Processos eletrônicos - Lei n. 13.793, de 3-1-2019 - Código Penal Importunação sexual, estupros coletivo e corretivo e divulgação de sexo, estupro ou nudez de vulnerável – Lei n. 13.718, de 24-9-2018 Exposição da intimidade sexual – Lei n. 13.772, de 19-12-2018 - Código de Processo Penal Prisão domiciliar para gestante – Lei n. 13.769, de 19-12-2018 - CLT Falta justificada ao trabalho para realização de exames preventivos de câncer – Lei n. 13.767, de 18-12-2018 - Estatuto da Criança e do Adolescente Prevenção de gravidez na adolescência – Lei n. 13.798, de 3-1-2019 - Estatuto da OAB Honorários assistenciais - Lei n. 13.725, de 4-10-2018 Processos eletrônicos – Lei n. 13.793, de 3-1-2019 - Reforma Trabalhista – aplicação de normas processuais da CLT (created_by, last_modified_by, IN n. 41, de 21-6-2018, do TST) - Lei de Proteção de Dados Clienteis (created_by, last_modified_by, Lei n. 13.709, de 14-8-2018) - Trabalho temporário no Mercosul  Decreto n. 9.499, de 10-9-2018) - Execução indireta de serviços na Administração Pública  Decreto n. 9.507, de 21-9-2018) - Tratado de Marraqueche  Decreto n. 9.522, de 8-10-2018) - Juizados Especiais - contagem de prazos processuais  Lei n. 13.728, de 31-10-2018) - Gestão coletiva de direitos autorais  Decreto n. 9.574, de 22-11-2018) - Criança, adolescente e aprendiz  Decreto n. 9.579, de 22-11-2018) - Organização da Justiça Militar – alterações  Lei n. 13.774, de 19-12-2018) - Duplicata eletrônica  Lei n. 13.775, de 20-12-2018) - Contratos de compra e venda – resolução por inadimplência  Lei n. 13.786, de 27-12-2018) - Autoridade Nacional de Proteção de Dados Clienteis  MP 869, de 27-12-2018) - Ausência escolar por motivo religioso  Lei n. 13.796, de 3-1-2019) - Facilitação da posse de arma  alterações no Decreto do Desarmamento)','9788553603299',2600,'2019-02-11',15.00, 1002, 30);
	INSERT INTO livros(created_by, last_modified_by, codBarras, imagenUrl, nome, edicao,  idioma,  descricao, isbn13, numeroPaginas, dataPublicacao, valorUnitario, idEditora, quantidade) VALUES ('system', 'system', '5435468531', 'https://picsum.photos/id/4/200/300','História Geral do Brasil', 'Ed. 10ª',   'PORTUGUES', 'A História Geral do Brasil Parte I é um balanço moderno, atual e renovador do conjunto da História do Brasil, com a participação de historiadores consagrados por suas pesquisas e livros sobre os diversos períodos da nossa história de grandes universidades brasileiras - UFRJ, UFF, UERJ, UPE e UnB. Em linguagem simples, direta e rigorosa o livro percorre a história do país desde a colonização até os nossos dias, com ênfase nas caraterísticas gerais da colonização, na formação dos grupos sociais brasileiros, no Império e suas grandes características, incluindo a escravidão e sua superação. Analisa-se, também ,a criação da República e a ampliação da participação política no Brasil, suas crises, sucessos e transformações, com a emergência da classe operária, da urbanização e da industrialização.','978-8535285435','528', '2015-07-10', 5.00, 1003, 10);
