	INSERT INTO autores(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Cury Augusto', 'Dr. Augusto Cury é psiquiatra, pesquisador e escritor. Seus livros são publicados em mais de 70 países e já vendeu mais de 30 milhões de livros somente no Brasil. O Best-Seller O Vendedor de Sonhos se tornou um filme e foi lançado nos cinemas em 2016. É autor da Teoria da Inteligência Multifocal, que analisa o processo de construção dos pensamentos. Idealizador do programa da Escola da Inteligência, que ensina educação sócio emocional para mais de 300 mil alunos, entre crianças e adolescentes. Criador da AGE - Academia de Gestão da Emoção Online, que tem como missão, democratizar todas as suas ferramentas de Gestão da Emoção, não apenas no Brasil, mas em todos os povos e culturas. Criador do Primeiro Programa Social e Gratuito - Você é Insubstituível – Uma Vacina Emocional contra o Suicídio.');
	INSERT INTO autores(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Paul J. Deitel','CEO e Diretor Técnico da Deitel & Associates, Inc., é formado pela MIT Sloan School of Management, onde estudou Tecnologia da Informação. Ele detém as certificações profissionais Java Certified Programmer e Java Certified Developer, foi designado pela Oracle Corporation como um Java Champion - "um membro proeminente da comunidade Java cuja entrada é solicitada pela empresa para melhorar a plataforma Java", e é um MVP do Microsoft C #. Ele ministrou cursos de linguagem de programação para clientes, incluindo várias empresas da Fortune 1000, organizações governamentais e militares, e é um dos treinadores corporativos mais experientes do mundo. ');
	INSERT INTO autores(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Autor - Grupo Saraiva','Saraiva é uma livraria fundada em 13 de dezembro de 1914 por Joaquim Inácio da Fonseca Saraiva, imigrante português de Trás-os-Montes, no centro da cidade de São Paulo. Em 2008 a empresa adquiriu a Livraria Siciliano e passou a ter 20% do mercado livreiro do Brasil. Com o setor em crise, a Saraiva entrou com um pedido de recuperação judicial no dia 23 de novembro de 2018, com uma divida de R$ 674 milhões, fechou 19 lojas pelo Brasil no mês de outubro, restando 85 lojas físicas');
	INSERT INTO autores(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Maria Yedda','Maria Yedda foi, desde cedo, uma mulher forte e decidida, assumindo, num Brasil ainda provinciano, um papel de protagonismo em decisões pouco usuais: a opção pelo trabalho profissional – inicialmente no recém-criado DASP –, quase que ainda adolescente, a ida para os Estados Unidos  para o Barnard College, da Universidade de Columbia) e, no retorno, em plena Segunda Guerra Mundial, num engajamento completo na luta contra os fascismos em expansão na Europa e no Brasil. Tornou-se uma das organizadoras da União Nacional dos Estudantes, no seu departamento cultural, quando inicia, ao lado de grandes intelectuais brasileiros, um combate coerente e constante em toda sua vida contra o fascismo. ');
