	INSERT INTO editoras(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Benvirá', 'Em 2008, a Saraiva compra a Siciliano, trazendo para a editora o selo ARX, de ficção e não ficção. Dois anos depois, ARX vira Benvirá, e o novo selo se reposiciona no mercado com um catálogo único, mais literário: dos clássicos norte-americanos William Faulkner e John dos Passos a premiados representantes da literatura hispano-americana, como Pola Oloixarac, José Donoso e Juan Eslava Galán.');
	INSERT INTO editoras(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Pearson', 'As origens da Pearson datam de 1724, quando Thomas Longman fundou a Longman, mas a Pearson, na verdade, foi fundada em 1844 por Samuel Pearson como S. Pearson and Son, uma pequena empresa de construção, em Yorkshire, no norte da Inglaterra. Por volta de 1880, a Pearson tornou-se uma das maiores construtoras do mundo, em um momento em que a indústria controlava desenvolvimento dos transportes, comércio e telecomunicações que alimentavam as economias mundiais.');
	INSERT INTO editoras(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'Editora - Grupo Saraiva', 'Saraiva é uma livraria fundada em 13 de dezembro de 1914 por Joaquim Inácio da Fonseca Saraiva, imigrante português de Trás-os-Montes, no centro da cidade de São Paulo. Em 2008 a empresa adquiriu a Livraria Siciliano e passou a ter 20% do mercado livreiro do Brasil. Com o setor em crise, a Saraiva entrou com um pedido de recuperação judicial no dia 23 de novembro de 2018, com uma divida de R$ 674 milhões, fechou 19 lojas pelo Brasil no mês de outubro, restando 85 lojas físicas');
	INSERT INTO editoras(created_by, last_modified_by, nome, descricao) VALUES ('system', 'system', 'LEFT JOIN TEST','O JOIN É  líder mundial em soluções de informação que vão desde a publicação de literatura científica, médica e técnica até os mais modernos sistemas e plataformas, que possibilitam melhorias no desenvolvimento da ciência, saúde e também na capacitação dos profissionais de tecnologia. Somos uma empresa internacional de publicação multimídia com mais de 20.000 produtos para a ciência educacional e profissional, além de comunidades de saúde em todo o mundo. Com isso, é possível a melhor tomada de decisão para oferecer atendimento de excelência e, por vezes, fazer descobertas inovadoras que avançam as fronteiras do conhecimento e do progresso humano.');
